import React from 'react';
import './home.css';

// Replace these with your actual image/video assets
import heroImage from './assets/hero-image.jpg';
import feature1 from './assets/feature1.jpg';
import feature2 from './assets/feature2.jpg';
import demoVideo from './assets/demo-video.mp4';

const Home = () => {
  return (
    <div className="home">
      {/* ===== HERO SECTION ===== */}
      <div className="hero" style={{ backgroundImage: `url(${heroImage})` }}>
        <div className="hero-content">
          <h1>Shop, sell, and connect around the things you love.</h1>
          <button className="download-button">Download Whatnot</button>
        </div>
      </div>

      {/* ===== FEATURE IMAGES ===== */}
      <section className="features">
        <h2>What We Offer</h2>
        <div className="feature-grid">
          <div className="feature-card">
            <img src={feature1} alt="Feature 1" />
            <p>Fast-paced live auctions</p>
          </div>
          <div className="feature-card">
            <img src={feature2} alt="Feature 2" />
            <p>Exclusive collectibles</p>
          </div>
        </div>
      </section>

      {/* ===== VIDEO SECTION ===== */}
      <section className="demo-video-section">
        <h2>See Whatnot in Action</h2>
        <video controls>
          <source src={demoVideo} type="video/mp4" />
          Your browser does not support the video tag.
        </video>
      </section>
    </div>
  );
};

export default Home;
